Actionscript.script:
function 攻击时移动(慢速度, 快速度)
{
   if(_parent.方向 == "右")
   {
      _parent.移动("右",慢速度);
   }
   else if(_parent.方向 == "左")
   {
      _parent.移动("左",慢速度);
   }
}
百分比集体加血 = _root.加血动作.主唱百分比集体加血;

gotoAndPlay(_parent.近战招式);

if(random(100) < 50)
{
   if(_parent.防御力 < _parent.基本防御力 * 10)
   {
      _parent.防御力 += _parent.基本防御力 * 0.02;
   }
   if(_parent.空手攻击力 < _parent.基本空手攻击力 * 5)
   {
      _parent.空手攻击力 += _parent.基本空手攻击力 * 0.02;
   }
   _root.效果("灯光增幅",_parent._x,_parent._y,100);
}

if(random(100) < 50)
{
   if(_parent.行走X速度 < _parent.基本速度 * 1.3)
   {
      _parent.行走X速度 += 1;
      _parent.行走Y速度 = _parent.行走X速度 / 2;
      _parent.跑X速度 = _parent.行走X速度 * 2;
      _parent.跑Y速度 = _parent.行走X速度;
   }
   if(_parent.被击硬直度 > _parent.基本被击硬直度 / 2)
   {
      _parent.被击硬直度 -= 3;
   }
   _root.效果("天蓝增幅",_parent._x,_parent._y,100);
}

if(random(100) < 50)
{
   if(_parent.防御力 < _parent.基本防御力 * 10)
   {
      _parent.防御力 += _parent.基本防御力 * 0.01;
   }
   if(_parent.空手攻击力 < _parent.基本空手攻击力 * 5)
   {
      _parent.空手攻击力 += _parent.基本空手攻击力 * 0.01;
   }
   _root.效果("灯光增幅",_parent._x,_parent._y,100);
}

if(random(100) < 50)
