function 透明攻击(倍率)
{
	子弹属性 = _root.子弹属性初始化(this.攻击点);

	子弹属性.声音 = "";
	子弹属性.霰弹值 = 1;
	子弹属性.子弹散射度 = 1;
	子弹属性.子弹种类 = "透明子弹";
	子弹属性.子弹威力 = _parent.空手攻击力 * 倍率;
	子弹属性.子弹速度 = 0;
	子弹属性.Z轴攻击范围 = 30;
	子弹属性.击倒率 = 50;

	//子弹属性.最小霰弹值 = 3;

	子弹属性.伤害类型 = "魔法";
	//子弹属性.魔法伤害属性 = "能";

	子弹属性.区域定位area = this.攻击点;

	_root.子弹区域shoot传递(子弹属性);
}
function 近战联弹攻击(倍率,霰弹值,Z轴攻击范围)
{
	子弹属性 = _root.子弹属性初始化(this.攻击点);

	子弹属性.声音 = "";
	子弹属性.霰弹值 = 霰弹值;
	子弹属性.子弹散射度 = 1;
	子弹属性.子弹种类 = "近战联弹";
	子弹属性.子弹威力 = _parent.空手攻击力 * 倍率;
	子弹属性.子弹速度 = 0;
	子弹属性.Z轴攻击范围 = Z轴攻击范围 ? Z轴攻击范围 : 30;
	子弹属性.击倒率 = 10;

	子弹属性.最小霰弹值 = 2;

	子弹属性.伤害类型 = "魔法";
	//子弹属性.魔法伤害属性 = "能";

	子弹属性.区域定位area = this.攻击点;

	_root.子弹区域shoot传递(子弹属性);
}

if(_parent.近战招式 == "拔刀裂空斩"){
	gotoAndPlay("拔刀裂空斩跳转");
}

if(_parent.近战招式 == "横向裂空斩"){
	gotoAndPlay("横向裂空斩跳转");
}

距离X = _root.gameworld[_parent.攻击目标]._x - _parent._x;
if (_root.gameworld[_parent.攻击目标].hp > 0)
{
	if (距离X > 0)
	{
		_parent.方向改变("右");
	}
	else
	{
		_parent.方向改变("左");
	}
}

距离X = _root.gameworld[_parent.攻击目标]._x - _parent._x;
if (_root.gameworld[_parent.攻击目标].hp > 0)
{
	if (距离X > 0)
	{
		_parent.方向改变("右");
	}
	else
	{
		_parent.方向改变("左");
	}
}

onClipEvent(load){
   声音 = "";
   霰弹值 = 3;
   子弹散射度 = 3;
   发射效果 = "";
   子弹种类 = "近战子弹";
   子弹威力 = _parent._parent.空手攻击力 * 0.8;
   子弹速度 = 0;
   击中地图效果 = "";
   Z轴攻击范围 = 30;
   击倒率 = 100;
   击中后子弹的效果 = "空手攻击火花";
   if(_parent._parent.是否为敌人 == true)
   {
      子弹敌我属性 = false;
   }
   else
   {
      子弹敌我属性 = true;
   }
   var myPoint = {x:this._x,y:this._y};
   _parent.localToGlobal(myPoint);
   _root.gameworld.globalToLocal(myPoint);
   shootX = myPoint.x;
   shootY = myPoint.y;
   _root.子弹区域shoot(声音,霰弹值,子弹散射度,发射效果,子弹种类,子弹威力,子弹速度,Z轴攻击范围,击中地图效果,_parent._parent._name,shootX,shootY,_parent._parent.Z轴坐标,子弹敌我属性,击倒率,击中后子弹的效果);
}

